import React from "react";
import Footer from "../../components/Footer/Footer";
import Topbar from "../../components/Topbar/Topbar";
import sitting from "../../images/sitting.png"

function Homebody(){
    return (
        <div>

        <div class="body1">
            <h1>hello</h1>
            <p>hello</p>
                <img src={sitting} class="sitting" />

        </div>

         <div class="body1">
            <img src="sitting.png" alt="" class="sitting" />
            <div class="social">
            <p  class="arrow">&#8595;</p>
            <img class="linked-in" src="linked in.png"  alt="" />
            <img class="instagram" src="instagram.png"  alt="" />

            </div>
            <div class="body1">
        <p class="tagline">The News and Publication Society of IARE</p>
        <p class="description">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Vitae sed magna malesuada in interdum massa. Odio vel interdum ultrices tellus.</p>
        <h1 class="subscribe">Subscribe</h1>
    </div>
        </div>

        </div>
    );
}

function Home(){
    return(
        <>
        <Topbar />
        <Homebody />
        <Footer />
        </>

    );
}
export default Home;
